import React from 'react';

function Header(){
  return(

    <header style={headerStyle}>
      <div class="ThreadDetector-header">
     <h1>THREAT DETECTOR</h1>
     <form name='basic-form' action='javascript:;' onsubmit='formSubmit(this)'>
         <input type='text' id='formtext' name='formtext'></input>
         <input type='submit'></input>
       </form>
       <h3>App Response:</h3>
       <p id='app-response'></p>
     </div>
    </header>
  )
}

const headerStyle={
  background:'#87cefa',
  color:'#fff',
  textAlign:'center',
  padding:'10px'
}

export default Header;
